import React, { useEffect, useState } from "react";
import { useActions } from "../../../hooks/useActions";
import { useTypedSelector } from "../../../hooks/useTypedSelector";
import { BrandsState } from "../../../types/brand";
import './FilterCategories.css'

const FilterCategories = () => {

    const [a, setA] = useState([])


    const { } = useTypedSelector(state => state.productsReducer)
    const { fetchBrands } = useActions()
    useEffect( () => {
        // fetchBrands() 
        async function getJson () {
            const response = await fetch('../../../../public/brands.json')
            const jsonData = await response.json()
            const data = jsonData.map(( person: {id: number, title: string, sort: string, code: string} ) => ({
                id: person.id,
                title: person.title,
                sort: person.sort,
                code: person.code    
            }))
            setA(data);   
        }
        getJson()
    }, [])



    return (
    <>
        <h2> Бренды </h2>
        <div className="filterBrands">
            <input type='checkbox'  />
            <p> Brand 1</p>
        </div>
        <div className="filterBrands">
            <input type='checkbox'  />
            <p> Brand 2</p>
        </div>
        <div className="filterBrands">
            <input type='checkbox'  />
            <p> Brand 3</p>
        </div>
        <div className="filterBrands">
            <input type='checkbox'  />
            <p> Brand 4</p>
        </div>
    </>
    )
}

export default FilterCategories
